import React from 'react';
import Header from "../../helpers/Headers";
import TitleAndServices from "../../helpers/TitleAndServices";

function Prices(props) {
    return (
        <div className="body">
            <Header prices={true}></Header>
            <TitleAndServices title="Вычеслить цену"></TitleAndServices>
        </div>
    );
}

export default Prices;
